{"text":"Esse grupo de estoque foi criado especificamente para receber remessas em garantia. Como esse tipo de remessa não permite o uso de itens com controle total, foi necessário criar o grupo de estoque 23.

A ideia foi "duplicar" o item original (com controle total), mas com características simplificadas, adequadas apenas para esse processo. No entanto, como esse item duplicado não possui os parâmetros corretos para compra, ele não deve ser usado em solicitações de compra ou na regularização de notas fiscais (NF).

O problema é que, por estar disponível no sistema, muitas pessoas acabam utilizando esse item de forma inadequada nesses processos, o que pode gerar erros ou inconsistências.","changed_at":"2025-08-07T20:38:20.867Z"}
